@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document regexp('(?!http://www\.google.*).*(calendar).*') {

  div.month-row > table.st-bg-table > tbody > tr > td {background-color:  /*[[column_1]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td {background-color:  /*[[column_2]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td + td {background-color:  /*[[column_3]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td + td + td {background-color:  /*[[column_4]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td + td + td + td {background-color:  /*[[column_5]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td + td + td + td + td {background-color:  /*[[column_6]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td + td + td + td + td + td + td {background-color:  /*[[column_7]]*/!important;}
  div.month-row > table.st-bg-table > tbody > tr > td.st-bg-today {background-color:  /*[[today]]*/!important;}

}
